-- ----------------------------
-- Table structure for arrangeset
-- ----------------------------
DROP TABLE IF EXISTS `arrangeset`;
CREATE TABLE `arrangeset`  (
  `id` int unsigned NOT NULL,
  `weekstart` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '每周的开始时间',
  `signin` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '上班无签到记',
  `signoff` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '下班无签退记',
  `aday` int(0) NOT NULL COMMENT '多长时间记为一整天',
  `reality` tinyint(1) NOT NULL COMMENT '计算实到减去早退的时间',
  `alate` int(0) NOT NULL COMMENT '迟到多少分钟记为旷工',
  `bleave` int(0) NOT NULL COMMENT '迟到多少分钟记为早退',
  `overtime` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否根据签卡的记录记为加班',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

