-- ----------------------------
-- Table structure for quantum
-- ----------------------------
DROP TABLE IF EXISTS `quantum`;
CREATE TABLE `quantum`  (
  `quanid` int unsigned NOT NULL COMMENT '时间段编号',
  `quanname` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '时间段名称',
  `quanstart` time(0) NOT NULL COMMENT '时间段开始时间',
  `quanend` time(0) NOT NULL COMMENT '时间段结束',
  `allowlate` int unsigned NOT NULL COMMENT '允许迟到多长时间',
  `allowleave` int unsigned NOT NULL COMMENT '允许早退多长时间',
  `signin` tinyint(1) NOT NULL COMMENT '是否必须签到',
  `signoff` tinyint(1) NOT NULL COMMENT '是否必须签退',
  `signinbefore` int unsigned NOT NULL COMMENT '上班前多长时间内可以签到 分钟',
  `signinafter` int unsigned NOT NULL COMMENT '上班后多长时间可以签到',
  `signoffbefore` int unsigned NOT NULL COMMENT '下班前多长时间可以签退',
  `signoffafter` int unsigned NOT NULL COMMENT '下班后多长时间可以签退',
  `rest` tinyint(1) NOT NULL COMMENT '是否扣除休息时间 0 false 1true',
  `firststart` time(0) NOT NULL COMMENT '第一段休息时间开始',
  `firstend` time(0) NOT NULL COMMENT '第一段休息时间结束',
  `secondstart` time(0) NOT NULL COMMENT '第二段休息时间开始',
  `secondend` time(0) NOT NULL COMMENT '第二段休息时间结束',
  `overtimebefore` tinyint(0) NOT NULL DEFAULT 0 COMMENT '上班前多长时间记为加班',
  `overtimeafter` tinyint(0) NOT NULL DEFAULT 0 COMMENT '下班后多长时间记为加班',
  `overtime` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '是否记加班 0默认不计加班 1上班记加班  2下班后记加班  存储数组 格式0/1/2 或者',
  PRIMARY KEY (`quanid`, `quanname`) USING BTREE,
  UNIQUE INDEX `quan_id`(`quanid`, `quanname`) USING BTREE,
  INDEX `quanid`(`quanid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 33 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

