-- ----------------------------
-- Table structure for users
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users`  (
  `userid` int(10) UNSIGNED ZEROFILL NOT NULL AUTO_INCREMENT COMMENT '用户账号',
  `name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户名称',
  `deptname` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '所在部门',
  `rankname` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '班次名称',
  `sex` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '男' COMMENT '性别',
  `identitycard` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '身份证号',
  `email` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '邮箱',
  `phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '电话号码',
  `cardcode` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '卡号',
  `education` tinyint(1) NOT NULL DEFAULT 0 COMMENT '学历类型\r\n\r\n    0 表示为中专\r\n    1 表示为高中\r\n    2 表示为专科\r\n    3 表示为本科\r\n    4 表示为研究生\r\n    5 表示为博士生\r\n\r\n允许值: 0, 1, 2, 3, 4, 5 ',
  `atten` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否参与考勤（0表示不参与 ，1表示参与）',
  `inlate` tinyint(1) NULL DEFAULT 0 COMMENT '上班签到\r\n\r\n    0 表示为依据对应时间段\r\n    1 上班必须签到\r\n    2 上班不用签到\r\n\r\n允许值: 0, 1, 2 ',
  `outear` tinyint(1) NULL DEFAULT 0 COMMENT '下班签退\r\n\r\n    0 表示为依据对应时间段\r\n    1 下班必须签到\r\n    2 下班不用签到\r\n\r\n允许值: 0, 1, 2 ',
  `editdate` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '操作日期',
  `password` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  PRIMARY KEY (`userid`) USING BTREE,
  UNIQUE INDEX `userid`(`userid`) USING BTREE,
  INDEX `name`(`name`) USING BTREE,
  INDEX `rankname`(`rankname`) USING BTREE,
  INDEX `usersdept`(`deptname`) USING BTREE,
  INDEX `userid_2`(`userid`, `name`, `deptname`) USING BTREE,
  CONSTRAINT `rankname` FOREIGN KEY (`rankname`) REFERENCES `attenrank` (`rankname`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `usersdept` FOREIGN KEY (`deptname`) REFERENCES `dept` (`deptname`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 51982 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

